import img from "../../../assets/img/backgroundSignin.jpg"
import classes from "./AddRoomPage.module.css"
import { Link, useParams } from "react-router-dom";
import { useRef, useContext } from "react"
import AuthContext from '../../../store/auth-context';

const typeData = [
    {
        text: "Family House",
        value: "0"
    },
    {
        text: "House & Villa",
        value: "1"
    },
    {
        text: "Apartment",
        value: "2"
    },
    {
        text: "Office & Studio",
        value: "3"
    },
    {
        text: "Villa & Condo",
        value: "4"
    },
    
]

const AddRoomPage = () => {
    const params = useParams()

    const id = params.id
    
    console.log(id)
    
    const authCtx = useContext(AuthContext)
    
    const [values, setValues] = useState({
        house_id: id,
        room_name: '',
        room_type: '0',
        manager_id: authCtx.userId,
        area: 0,
        max_tenant: 1,
        rent_price: 0,
        water_price: 0,
        electricity_price: 0,
        service_price: 0,
        detail: '',
    })
    
    // {
    //     "house_id": "1",
    //     "room_name": "Phòng tầng 3",
    //     "room_type": "0",
    //     "manager_id": "4",
    //     "area": "15",
    //     "max_tenant": "1",
    //     "rent_price": "2000000",
    //     "water_price": "50000",
    //     "electricity_price": "3000",
    //     "service_price": "100000",
    //     "detail": "Phòng khép kín"
    // }
    
    
    const categoryInputRef = useRef("")
    const nameInputRef = useRef("")
    const areaInputRef = useRef("")
    const rentPriceInputRef = useRef("")
    const waterPriceInputRef = useRef("")
    const electricityPriceInputRef = useRef("")
    const servicePriceInputRef = useRef("")
    const detailInputRef = useRef("")
    
    const submitHandler = (event) => {
        event.preventDefault();
        
        const enteredCategory = categoryInputRef.current.value;
        const enteredName = nameInputRef.current.value;
        const enteredArea = areaInputRef.current.value;
        const enteredRentPrice = rentPriceInputRef.current.value;
        const enteredWaterPrice = waterPriceInputRef.current.value;
        const enteredElectricityPrice = electricityPriceInputRef.current.value;
        const enteredServicePrice = servicePriceInputRef.current.value;
        const enteredDetail = detailInputRef.current.value;
        
        console.log(enteredCategory, enteredName, enteredArea, enteredRentPrice, enteredWaterPrice, enteredElectricityPrice, enteredServicePrice, enteredDetail)
        
        // optional: Add validation
        
        // fetch(
        //     'http://localhost:8080/api/balanha/addhouse',
        //     {
        //         method: 'POST',
        //         body: JSON.stringify({
        //             category: enteredCategory,
        //             city: enteredCity,
        //             district: enteredDistrict,
        //             street: enteredStreet,
        //             detail: enteredDetail,
        //             description: enteredDescription
        //         }),
        //         headers: {
        //             'Content-Type': 'application/json',
        //             'user_id': `${authCtx.userId}`, 
        //             'token': `${authCtx.token}`
        //         },
        //     }
        // ).then((res) => {
        //     if (res.ok) {
        //         return res.json();
        //     } else {
        //         return res.json().then((data) => {
        //             let errorMessage = 'Authentication failed!';
        //             // if (data && data.error && data.error.message) {
        //             //   errorMessage = data.error.message;
        //             // }
        
        //             throw new Error(errorMessage);
        //         });
        //     }
        // })
        // .then((data) => {
        //     console.log(data)
        //     alert("Success")
        // })
        // .catch((err) => {
        //     alert(err.message);
        // });
    }
    
    return (
        <section className={classes.back}>
            <div className={classes.center}>
                <h1>Add Room</h1>
                <form method="POST" onSubmit={submitHandler}>
                    <div className={classes.txt_field}>
                        <select 
                            ref={categoryInputRef}
                        >
                            {typeData.map(type => <option value={type.value}>{type.text}</option>)}
                        </select>
                        <span></span>
                        <label>Type</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="text" required ref={nameInputRef}/>
                        <span></span>
                        <label>Name</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required ref={areaInputRef}/>
                        <span></span>
                        <label>Area</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required ref={rentPriceInputRef}/>
                        <span></span>
                        <label>Rent Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required ref={waterPriceInputRef}/>
                        <span></span>
                        <label>Water Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required ref={electricityPriceInputRef}/>
                        <span></span>
                        <label>Electricity Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required ref={servicePriceInputRef}/>
                        <span></span>
                        <label>Service Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="text" required ref={detailInputRef}/>
                        <span></span>
                        <label>Detail</label>
                    </div>
                    <button type="submit">Add</button>
                    <div className={classes.signup_link}>
                        <Link to="/">home</Link>
                    </div>
                </form>
            </div>
            <img src={img} alt='' />
        </section>
    )
}

export default AddRoomPage
